import React from 'react';
import GapDataWithChart from './GapDataWithChart';

function GapList({ gaps, onSelectGap }) {
  if (!Array.isArray(gaps) || gaps.length === 0) {
    return <p>No gap data available.</p>;
  }

  return (
    <div className="gap-list">
      {gaps.map((gap, index) => (
        <GapDataWithChart 
          key={`${gap.ticker || 'unknown'}-${gap.date || index}`}
          gap={gap}
          onSelectGap={onSelectGap}
        />
      ))}
    </div>
  );
}

export default GapList;
